import React from "react";

const DogCard = ({ dog, handleFavorite }) => {
  console.log("dog card", dog);
  return (
    <div>
      <li>
        <h2>{dog.name}</h2>
        <img alt="" src={dog.img} />
        <h3>{dog.breed}</h3>
        <h3>{dog["age in human years"]}</h3>
        <h3>{dog["default-mood"]}</h3>
        <button onClick={e => handleFavorite(e, dog)}>Favorite</button>
        <button>Ban</button>
      </li>
    </div>
  );
};

export default DogCard;
